import React from 'react';

const Introduction = () => {
  return (
    <div className="introduction">
      <h1>Welcome to My Portfolio</h1>
      <h2>Hi, I'm Karandeep Nagpal</h2>
      <p>
        I'm a [Your Profession] with a passion for [Your Interests]. With a strong background in [Your Skills],
        I love to create innovative solutions to complex problems. My goal is to help companies and individuals
        build exceptional products and experiences.
      </p>
      <p>
        Feel free to explore my portfolio to learn more about my work, skills, and experiences.
      </p>
    </div>
  );
};

export default Introduction;
